import React from 'react';
import RoomList from '../components/RoomList';
import roomsData from '../data/roomsData'; // Importa el archivo de habitaciones

const Home = () => {
    return (
        <div>
            <h1>Bienvenido al Hostal</h1>
            <RoomList rooms={roomsData} />
        </div>
    );
};

export default Home;
